import React ,{Component} from 'react';
class BackToTop extends Component{
    render(){
        return(
            <BackToTop
                showOnScrollUp
                showAt={100}
                speed={1500}
                easing="easeInOutQuint"
            >
                <span>scroll up</span>
            </BackToTop>

        );
    }
}
export default BackToTop
